import React from 'react';
import Layout from '../Layout/Layout';
import './project.css';
import CtCard from '../Ui Kits/Cart/CT Card/CtCard';
import { NavLink } from 'react-router-dom';
import Ct_data from '../../Ct_data';
// images
import javascript from '../Assets/Images/Project Image/javascript.png';
import html from '../Assets/Images/Project Image/html.png';
import bootstrap from '../Assets/Images/Project Image/bootstrap.png';

function Project(props) {
  return (
    <div>
      <Layout>
        <Card
          key={props.id}
          imssrc={props.imssrc}
          catagry={props.catagry}
          title={props.title}
          link={props.link}
        />
        ;
        <div className='pr_main_div'>
          <h1>Project Category</h1>
          <div className='category'>
            {CtCard.map(Project)}
            {/* <NavLink
              exact
              // activeClassName='menu_active'
              className='nav-link active'
              // aria-current='page'
              to='/'
            >
              <CtCard ct_title='Html / css' image={html} />
            </NavLink>
            <CtCard ct_title='javascript' image={javascript} />
            <CtCard ct_title='bootstrap' image={bootstrap} />
            <CtCard ct_title='bootstrap' image={bootstrap} />

            <CtCard />
            <CtCard /> */}
          </div>
        </div>
      </Layout>
    </div>
  );
}

export default Project;
